import styled from "styled-components";

export const Wrapper = styled.div``;

export const Content = styled.div`
  display: flex;
  max-width: 1280px;
  margin: 0 auto;
  background: var(--darkGrey);
  color: #fff;
`;
export const Text = styled.div`
  text-decoration: none;
  list-style-type: none;
`;
